ReportDefinitionServiceReportOperator:
  type: string
  enum:
  - EQUALS
  - NOT_EQUALS
  - GREATER_THAN
  - GREATER_THAN_EQUALS
  - LESS_THAN
  - LESS_THAN_EQUALS
  - CONTAINS
  - IN
  - UNKNOWN
  title: ReportDefinitionServiceReportOperator
  description: "<div lang=\"ja\">ReportDefinitionServiceReportOperatorは、フィルタ条件を表します。</div><div lang=\"en\">ReportDefinitionServiceReportOperator\
    \ displays filtering conditions for the report.</div><hr>\n* <code>LESS_THAN_EQUALS</code>\
    \ - <div lang=\"ja\">指定の値以下です。</div><div lang=\"en\">Less than equals to selected value.</div>*\
    \ <code>CONTAINS</code> - <div lang=\"ja\">指定の値を含みます。</div><div lang=\"en\">Contains the selected value.</div>\
    * <code>IN</code> - <div lang=\"ja\">いずれかに一致します。</div><div lang=\"en\">Equals to whichever of selected value.</div>\
    * <code>EQUALS</code> - <div lang=\"ja\">指定の値と一致します。</div><div lang=\"en\">Equal to selected value.</div>*\
    \ <code>NOT_EQUALS</code> - <div lang=\"ja\">指定の値と一致しません。</div><div lang=\"en\">Does not equals to selected value.</div>\
    * <code>GREATER_THAN</code> - <div lang=\"ja\">指定の値を超えます。</div><div lang=\"en\">Greater than selected value.</div>\
    * <code>GREATER_THAN_EQUALS</code> - <div lang=\"ja\">指定の値以上です。</div><div lang=\"en\">Greater than equals to selected\
    \ value.</div>* <code>LESS_THAN</code> - <div lang=\"ja\">指定の値未満です。</div><div lang=\"en\">Less than selected\
    \ value.</div>* <code>UNKNOWN</code> - <div lang=\"ja\">未知の値です。</div><div lang=\"en\">Unknown Value</div>"
